    false,nt"url": null,nt"notes": "The Native American Graves Protection and
    Repatriation Act (NAGPRA) requires Federal agencies and museums receiving federal
    funds to inventory human remains, funerary objects, sacred objects, and objects
    of cultural patrimony, and to reach agreement on the repatriation or other disposition
    in consultation with lineal descendants or those who can demonstrate cultural affiliation.
    Under contract with the Fish and Wildlife Service, this report documents archaeological
    properties attributed to Native Americans and provides and inventory of artifact
    collections and documentation from archaeological investigations of these properties,
